// Button debouncing
unsigned long lastDebounceTime = 0;
unsigned long debounceDelay = 200;

void drawSatelliteScreen(int numSats) {
    if (numSats != prevSats) {
        display.fillScreen(BLACK);
        
        // Draw satellite icon
        display.drawLine(30, 32, 66, 32, WHITE);
        display.drawLine(38, 24, 58, 40, WHITE);
        display.drawLine(38, 40, 58, 24, WHITE);
        display.drawCircle(48, 32, 4, WHITE);
        
        // Draw satellite count
        display.setTextSize(2);
        display.setTextColor(WHITE);
        display.setCursor(75, 28);
        display.print(numSats);
        
        prevSats = numSats;
    }
}

void drawSpeedometer(float speed, int satellites, float distance, float avgSpd) {
    int currentSpeed = (int)speed;
    
    // Only update speed if it changed
    if (currentSpeed != prevSpeed) {
        // Clear speed area only
        display.fillRect(24, 20, 72, 24, BLACK);
        
        // Big speed in center
        display.setTextSize(3);
        display.setTextColor(currentSpeed > 80 ? RED : ORANGE);
        
        // Format speed string without leading zeros unless over 100
        char speedStr[4];
        if (currentSpeed >= 100) {
            sprintf(speedStr, "%03d", currentSpeed);
        } else {
            sprintf(speedStr, " %2d", currentSpeed);
        }
        display.setCursor(24, 20);
        display.print(speedStr);
        
        prevSpeed = currentSpeed;
    }

    // Only update demo indicator if mode changed
    static bool prevDemo = !demoMode;
    if (demoMode != prevDemo) {
        display.fillRect(0, 0, 30, 8, BLACK);
        if (demoMode) {
            display.setTextSize(1);
            display.setTextColor(WHITE);
            display.setCursor(0, 0);
            display.print("DEMO");
        }
        prevDemo = demoMode;
    }
    
    // Update satellites if changed
    if (satellites != prevSats) {
        display.fillRect(2, 56, 40, 8, BLACK);
        display.setTextSize(1);
        display.setTextColor(WHITE);
        display.setCursor(2, 56);
        display.print("SAT:");
        display.print(satellites);
        prevSats = satellites;
    }
    
    // Update distance if changed
    if (abs(distance - prevDist) > 0.1) {
        display.fillRect(48, 56, 48, 8, BLACK);
        display.setTextSize(1);
        display.setTextColor(WHITE);
        display.setCursor(48, 56);
        display.print(distance, 1);
        display.print("mi");
        prevDist = distance;
    }
    
    // Update average speed if changed
    if (abs(avgSpd - prevAvg) > 0.1) {
        display.fillRect(48, 2, 48, 8, BLACK);
        display.setTextSize(1);
        display.setTextColor(WHITE);
        display.setCursor(48, 2);
        display.print(avgSpd, 1);
        display.print("mph");
        prevAvg = avgSpd;
    }
}

void updateDemoValues() {
    demoSpeed += SPEED_INCREMENT;
    if (demoSpeed > MAX_DEMO_SPEED) {
        demoSpeed = 0;
    }
    demoDistance += 0.1;
}

void checkButton() {
    if ((millis() - lastDebounceTime) > debounceDelay) {
        if (digitalRead(BUTTON_PIN) == LOW) {
            demoMode = !demoMode;
            if (demoMode) {
                currentState = DEMO;
                demoSpeed = 0;
                demoDistance = 0;
                display.fillScreen(BLACK);  // Clear screen once when entering demo mode
                prevSpeed = -1;  // Reset all previous values
                prevSats = -1;
                prevDist = -1;
                prevAvg = -1;
            } else {
                currentState = ACQUIRING;
            }
            lastDebounceTime = millis();
        }
    }
}

void setup() {
    pinMode(BUTTON_PIN, INPUT);
    
    display.begin();
    display.setTextWrap(false);
    
    // Show BMW logo for 5 seconds
    display.fillScreen(BLACK);
    display.drawRGBBitmap(0, 0, image_data, 96, 64);
    delay(5000);
    
    display.fillScreen(BLACK);
    currentState = ACQUIRING;
}

void loop() {
    checkButton();
    
    switch(currentState) {
        case ACQUIRING:
            if (!demoMode) {
                drawSatelliteScreen(0);
            }
            break;
            
        case DEMO:
            updateDemoValues();
            drawSpeedometer(
                demoSpeed,
                DEMO_SATELLITES,
                demoDistance,
                demoSpeed * 0.8  // Simple average speed calculation for demo
            );
            delay(50);  // Control demo speed
            break;
    }
}